import React from 'react';
import { makeStyles, createStyles, Theme } from '@material-ui/core/styles';
import Paper from '@material-ui/core/Paper';
import Grid from '@material-ui/core/Grid';
import Avatar from '@material-ui/core/Avatar'
import Typography from '@material-ui/core/Typography'

const useStyles = makeStyles((theme: Theme) =>
  createStyles({
    root: {
      flexGrow: 1,
    },
    paper: {
      padding: theme.spacing(2),
      textAlign: 'center',
      color: theme.palette.text.secondary,
    },
  }),
);

interface IData {
  data: ITenant[]
}

export function Details(props: IData) {
  const classes = useStyles();

  return (
      <div>
          {props.data.map(res => (
              <Grid item xs={6}>
              <Paper className={classes.paper}>

                  <Grid container justify="flex-start" alignItems="flex-start" spacing={3}>

                      <Grid item xs={12} style={{backgroundColor:'#dedede'}}>
                          <Avatar style={{float:'left'}} alt={res.bed} src="/static/images/avatar/1.jpg" />
                          <div>
                              <Typography style={{color:'#000'}}>{res.name}</Typography>
                              <Typography color="inherit">{res.email}</Typography>
                          </div>
                      </Grid>

                      <Grid item xs={6}>
                          <div style={{float:'left'}}>
                              <Typography>Province: {res.province}</Typography>
                              <Typography>City: {res.city}</Typography>
                              <Typography>House no.: {res.houseNum}</Typography>
                          </div>
                      </Grid>

                      <Grid item xs={6}>
                      <div style={{float:'left'}}>
                          <Typography>Company : {res.company}</Typography>
                          <Typography>Occupation : {res.occupation}</Typography>
                          <Typography>Contact no.: {res.contactNum}</Typography>
                      </div>
                      </Grid>

                  </Grid>

                  </Paper>
              </Grid>
          ))}
      </div>
  )
}

export default function TenantDetails() {
  const classes = useStyles();

  return (
    <div className={classes.root}>
      <Grid container spacing={3}>

        {['A','B','C','D'].map(res => (
          <Grid item xs={6}>
            <Paper className={classes.paper}>

              <Grid container justify="flex-start" alignItems="flex-start" spacing={3}>

                <Grid item xs={12} style={{backgroundColor:'#dedede'}}>
                  <Avatar style={{float:'left'}} alt={res} src="/static/images/avatar/1.jpg" />
                  <div>
                    <Typography style={{color:'#000'}}>{'John Isaac B Caasi'}</Typography>
                    <Typography color="inherit">{'Philippines Urban Living Solutions'}</Typography>
                  </div>
                </Grid>

                <Grid item xs={6}>
                  <div style={{float:'left'}}>
                    <Typography>Province: {'Metro Manila'}</Typography>
                    <Typography>City: {'Pasay'}</Typography>
                    <Typography>House no.: {'1234 st.'}</Typography>
                  </div>
                </Grid>

                <Grid item xs={6}>
                  <div style={{float:'left'}}>
                    <Typography>Province: {'Metro Manila'}</Typography>
                    <Typography>City: {'Pasay'}</Typography>
                    <Typography>House no.: {'1234 st.'}</Typography>
                  </div>
                </Grid>

              </Grid>

            </Paper>
          </Grid>
        ))}

      </Grid>
    </div>
  );
}
